import React from 'react';
import { render } from "react-dom";
import Clock from 'react-live-clock';

import Tabs from './tabs.js';
require('./App.css');
 
class TimeAndDate extends Component {
  render() { 
    <Clock format={'dddd, MMMM Do YYYY, HH:mm:ss a'} ticking={true} timezone={'US/Pacific'}/>
  }
}

function App() {
  return (
    <div>
      <h1>Home</h1>
      <h3>Time and Date</h3>
     <Tabs>
     <div label="Average of Data">
        Graph of Temperature, Moisture, and Humidity Averaged
      </div>
      <div label="Temperature">
        Graph of Temperature
      </div>
      <div label="Moisture">
        Graph of Moisture
      </div>
      <div label="Humidity">
        Graph of Humidity
      </div>
    </Tabs>
    </div>
  );
}

export default App;

